import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TPSoloIDS = () => {
  const [todosIds, setTodosIds] = useState([]);

  useEffect(() => {
    const fetchTodosIds = async () => {
      try {
        const response = await axios.get('http://jsonplaceholder.typicode.com/todos');
        const todos = response.data;
        const todosIds = todos.map(todo => todo.id);
        setTodosIds(todosIds);
      } catch (error) {
        console.error('Error fetching todos IDs:', error);
      }
    };

    fetchTodosIds();
  }, []);

  return (
    <div style={{ textAlign: 'center' }}>
      <style>
        {`
          .tp-todos-table {
            width: 80%; /* Ajustamos el ancho de la tabla */
            margin: 0 auto; /* Centramos la tabla */
            border-collapse: collapse;
            margin-top: 20px;
          }

          .tp-todos-table th, .tp-todos-table td {
            border: 1px solid #dddddd;
            padding: 12px; /* Incrementamos el padding */
            text-align: center;
          }

          .tp-todos-table th {
            background-color: #f2f2f2;
            font-weight: bold;
            font-size: 20px; /* Cambiamos el tamaño del texto */
          }

          .tp-todos-table td {
            background-color: #f9f9f9;
          }
        `}
      </style>
      <h2 style={{ margin: '20px 0' }}>Lista de todos los pendientes (solo IDs)</h2>
      <table className="tp-todos-table">
        <thead>
          <tr>
            <th>ID</th>
          </tr>
        </thead>
        <tbody>
          {todosIds.map(todoId => (
            <tr key={todoId}>
              <td>{todoId}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TPSoloIDS;
